                    <h2>Kochen</h2>
                    <p>
                        Gemeinsam kochen macht doppelt Spaß! Wir laden Eltern herzlich ein, zusammen mit ihren Kindern in unserer Küche kreativ zu werden. In entspannter Atmosphäre bereiten wir leckere und gesunde Gerichte zu, die Groß und Klein schmecken. Während die Kleinen fleißig mithelfen, schnippeln, rühren und kosten, können die Eltern sich austauschen und neue Rezepte entdecken. Es geht nicht nur ums Kochen, sondern auch darum, gemeinsam Zeit zu verbringen und den Kindern spielerisch Freude an frischen Lebensmitteln zu vermitteln. Am Ende genießen wir die selbstgemachten Köstlichkeiten zusammen. Kommt vorbei – wir freuen uns auf euch!
                    </p>
                </>;
    }
}

export default Cooking;
